import React from 'react';
import { View } from 'react-native';
import Svg, { G, Rect, Defs, Pattern, Use, Image, NumberProp } from 'react-native-svg';

// @see : https://transform.tools/svg-to-react-native
export function AuthenticationMiddleware(
  width: NumberProp | undefined,
  height: NumberProp | undefined
) {
  return (
    <Svg
      // ignore
      xmlns="http://www.w3.org/2000/svg"
      viewBox="0 20 250 220"
      width={width}
      height={height}
      fill="none"
    >
      <G opacity="100%" filter="url(#filter_dshadow_0_0_0_00000014)">
        <Rect width={256} height={256} rx={24} fill="url(#a)" />
        <Defs>
          <Pattern id="a" patternContentUnits="objectBoundingBox" width={1} height={1}>
            <Use
              href="#image_https://assets.api.uizard.io/api/cdn/stream/ebaee85c-adca-47ef-b9cf-c563c2ac315b.png"
              transform="scale(.00195)"
            />
          </Pattern>
        </Defs>
      </G>
      <Defs>
        <Image
          id="image_https://assets.api.uizard.io/api/cdn/stream/ebaee85c-adca-47ef-b9cf-c563c2ac315b.png"
          width={500}
          height={500}
          href="data:image/png;base64,"
        />
      </Defs>
    </Svg>
  );
}

// generic type casting any
// Bootleg fix
export class AuthenticationMiddlewareIcon extends React.Component<any> {
  render() {
    const style = this.props;
    const component = AuthenticationMiddleware(style.width, style.height);

    return <View style={style}>{component}</View>;
  }
}

export function SignupComponent(props: any) {
  return (
    <Svg
      xmlns="http://www.w3.org/2000/svg"
      viewBox="0 0 128 128"
      width={props?.width}
      height={props?.height}
      fill="none"
      {...props}
    >
      <G opacity="100%">
        <Rect width={128} height={128} rx={64} fill="url(#a)" />
        <Defs>
          <Pattern id="a" patternContentUnits="objectBoundingBox" width={1} height={1}>
            <Use
              href="#image_https://assets.api.uizard.io/api/cdn/stream/b4504e29-e93d-4fc9-8c38-1afe92d585ab.png"
              transform="scale(.00098)"
            />
          </Pattern>
        </Defs>
      </G>
      <Defs>
        <Image
          id="image_https://assets.api.uizard.io/api/cdn/stream/b4504e29-e93d-4fc9-8c38-1afe92d585ab.png"
          width={1024}
          height={1024}
          href="data:image/png;base64,"
        />
      </Defs>
    </Svg>
  );
}

export class SignupIcon extends React.Component<any> {
  render() {
    const { style } = this.props;
    const component = SignupComponent(style);
    return <View style={style}>{component}</View>;
  }
}
